// DataShowPage.jsx
import React from 'react';
import usersData from './UserData';

function DataShowPage() {
  // Assuming user is already authenticated to reach this page, so no need for further checks
  const userData = usersData.find(user => user.id === 'user1'); // Assuming we want to display user1's data

  return (
    <div>
      <h2>Welcome, {userData.name}</h2>
      <div>
        <p>ID: {userData.id}</p>
        <p>Name: {userData.name}</p>
        <p>Age: {userData.age}</p>
        <p>Email: {userData.email}</p>
      </div>
    </div>
  );
}

export default DataShowPage;
